"use strict";(self.webpackChunktwo=self.webpackChunktwo||[]).push([[783],{5542:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"/3_6_7","metadata":{"permalink":"/es/3_6_7","source":"@site/i18n/es/docusaurus-plugin-content-blog/3_6_7/index.mdx","title":"Notas de actualizaci\xf3n de YouTube\u2122 Dual Caption 3.6.7","description":"Desbloquee la calidad del video","date":"2022-04-27T00:00:00.000Z","formattedDate":"27 de abril de 2022","tags":[],"hasTruncateMarker":false,"authors":[{"name":"ouweiya","title":"Web Development","url":"https://github.com/ouweiya","imageURL":"img/avatar.png","key":"ouweiya"}],"frontMatter":{"authors":"ouweiya","date":"2022-04-27T00:00:00.000Z"},"nextItem":{"title":"Notas de actualizaci\xf3n de YouTube\u2122 Dual Caption 3.6.6","permalink":"/es/3_6_6"}},"content":"import WebStore from \'/src/components/WebStore\';\\nimport qualityUnlock from \'./qualityUnlock.png\';\\n\\n\\n\\n\\n### Desbloquee la calidad del video\\n\\nAhora se libera el bloqueo predeterminado de calidad de video, y puede cambiar de estado haciendo clic, y debe actualizar la p\xe1gina despu\xe9s de cambiar de estado.\\n\\n<img src={qualityUnlock} alt=\\"qualityUnlock.png\\" width=\\"330\\" height=\\"320\\" />\\n\\n<WebStore />"},{"id":"/3_6_6","metadata":{"permalink":"/es/3_6_6","source":"@site/i18n/es/docusaurus-plugin-content-blog/3_6_6/index.mdx","title":"Notas de actualizaci\xf3n de YouTube\u2122 Dual Caption 3.6.6","description":"### Arreglar bloqueo de calidad de video","date":"2022-04-11T00:00:00.000Z","formattedDate":"11 de abril de 2022","tags":[],"hasTruncateMarker":false,"authors":[{"name":"ouweiya","title":"Web Development","url":"https://github.com/ouweiya","imageURL":"img/avatar.png","key":"ouweiya"}],"frontMatter":{"authors":"ouweiya","date":"2022-04-11T00:00:00.000Z"},"prevItem":{"title":"Notas de actualizaci\xf3n de YouTube\u2122 Dual Caption 3.6.7","permalink":"/es/3_6_7"},"nextItem":{"title":"Notas de actualizaci\xf3n de YouTube\u2122 Dual Caption 3.6.5","permalink":"/es/3_6_5"}},"content":"import WebStore from \'/src/components/WebStore\';\\nimport qualityLock from \'./qualityLock.png\';\\nimport defaultStyle from \'./defaultStyle.png\';\\n\\n\\n\\n\\n ### Arreglar bloqueo de calidad de video\\n\\n La funci\xf3n de bloqueo de calidad de video se proporcion\xf3 en la versi\xf3n 3.6.3, pero cuando se selecciona Autom\xe1tico, la calidad a\xfan est\xe1 bloqueada y no se puede ajustar din\xe1micamente.Este problema ahora est\xe1 solucionado.\\n\\n<img src={qualityLock} alt=\\"qualityLock.png\\" width=\\"276\\" height=\\"389\\" />\\n\\n### Restaurar el estilo predeterminado de los subt\xedtulos\\n\\nLos estilos de subt\xedtulos preestablecidos se proporcionaron en versiones anteriores, y el estilo predeterminado de los subt\xedtulos ahora es consistente con YouTube.\\n\\nSi necesita volver al estilo predeterminado, puede hacer clic en el bot\xf3n Restablecer estilo.\\n\\n<img src={defaultStyle} alt=\\"defaultStyle.png\\" width=\\"340\\" height=\\"524\\" />\\n\\n<WebStore />"},{"id":"/3_6_5","metadata":{"permalink":"/es/3_6_5","source":"@site/i18n/es/docusaurus-plugin-content-blog/3_6_5/index.mdx","title":"Notas de actualizaci\xf3n de YouTube\u2122 Dual Caption 3.6.5","description":"### Arreglar los subt\xedtulos que no se envuelven","date":"2022-04-07T00:00:00.000Z","formattedDate":"7 de abril de 2022","tags":[],"hasTruncateMarker":false,"authors":[{"name":"ouweiya","title":"Web Development","url":"https://github.com/ouweiya","imageURL":"img/avatar.png","key":"ouweiya"}],"frontMatter":{"authors":"ouweiya","date":"2022-04-07T00:00:00.000Z"},"prevItem":{"title":"Notas de actualizaci\xf3n de YouTube\u2122 Dual Caption 3.6.6","permalink":"/es/3_6_6"},"nextItem":{"title":"Notas de actualizaci\xf3n de YouTube\u2122 Dual Caption 3.6.0","permalink":"/es/3_6_0"}},"content":"import WebStore from \'/src/components/WebStore\';\\nimport improveHandle from \'./improveHandle.gif\';\\nimport subtitleRightClickMenu from \'./subtitleRightClickMenu.gif\';\\nimport subtitleTips from \'./subtitleTips.png\';\\nimport subtitleWrap from \'./subtitleWrap.png\';\\n\\n\\n\\n\\n ### Arreglar los subt\xedtulos que no se envuelven\\n\\n Se solucion\xf3 un problema que causaba que los subt\xedtulos se desbordaran sin ajustarse cuando la fuente era demasiado grande en la versi\xf3n anterior.\\n\\n<img src={subtitleWrap} alt=\\"subtitleWrap.png\\" width=\\"600\\" height=\\"698\\" />\\n\\n### Arreglar aviso de subt\xedtulos\\n\\nEn versiones anteriores, la solicitud de subt\xedtulos tambi\xe9n usaba el estilo, y ahora se evita este problema.\\n\\n<img src={subtitleTips} alt=\\"subtitleTips.png\\" width=\\"600\\" height=\\"682\\" />\\n\\n### Mejorar el manejo\\n\\nLos botones de manija sol\xedan ser dif\xedciles de arrastrar cuando el subt\xedtulo se arrastraba al borde, ahora es m\xe1s f\xe1cil de usar cambiando la posici\xf3n de la manija.\\n\\n<img src={improveHandle} alt=\\"improveHandle.gif\\" width=\\"600\\" height=\\"338\\" />\\n\\n### Men\xfa contextual de subt\xedtulos\\n\\nEn el pasado, los subt\xedtulos se pod\xedan copiar, pero la operaci\xf3n de clic derecho no se pod\xeda realizar. Ahora este problema se ha mejorado.\\n\\n<img src={subtitleRightClickMenu} alt=\\"subtitleRightClickMenu.gif\\" width=\\"600\\" height=\\"313\\" />\\n\\n<WebStore />"},{"id":"/3_6_0","metadata":{"permalink":"/es/3_6_0","source":"@site/i18n/es/docusaurus-plugin-content-blog/3_6_0/index.mdx","title":"Notas de actualizaci\xf3n de YouTube\u2122 Dual Caption 3.6.0","description":"Arreglar la fusi\xf3n de declaraciones \ud83c\udf89","date":"2021-12-16T00:00:00.000Z","formattedDate":"16 de diciembre de 2021","tags":[],"hasTruncateMarker":false,"authors":[{"name":"ouweiya","title":"Web Development","url":"https://github.com/ouweiya","imageURL":"img/avatar.png","key":"ouweiya"}],"frontMatter":{"authors":"ouweiya","date":"2021-12-16T00:00:00.000Z"},"prevItem":{"title":"Notas de actualizaci\xf3n de YouTube\u2122 Dual Caption 3.6.5","permalink":"/es/3_6_5"},"nextItem":{"title":"Notas de actualizaci\xf3n de YouTube\u2122 Dual Caption 3.5.0","permalink":"/es/3_5_0"}},"content":"import WebStore from \'/src/components/WebStore\';\\nimport Tip from \'/src/components/Tip\';\\nimport mark from \'./mark.png\';\\nimport disableStyle from \'./disableStyle.gif\';\\nimport order from \'./order.gif\';\\n\\n\\n### Arreglar la fusi\xf3n de declaraciones \ud83c\udf89\\n\\n En la versi\xf3n anterior, la combinaci\xf3n de declaraciones no se realizaba para seguir el comportamiento de YouTube.\\n\\nEsto provoc\xf3 que las oraciones se entrecortaran al reproducir el video, y la descarga de subt\xedtulos tambi\xe9n provoc\xf3 que la l\xednea de tiempo se saturara.\\n\\nEn la versi\xf3n 3.6.0, este problema se solucion\xf3 y se optimizaron m\xe1s detalles.\\n\\nSe eliminaron los espacios adicionales en las declaraciones de combinaci\xf3n.\\n\\n```\\n 1\\n 00:00:03,678 --\x3e 00:00:05,960\\n means that many aspects  of our lives\\n \u610f\u5473\u7740 \u6211\u4eec\u751f\u6d3b\u7684\u8bb8\u591a\u65b9\u9762\\n\\n 2\\n 00:00:05,960 --\x3e 00:00:08,214are regulated  by a weird entity.\\n \u90fd \u53d7\u5230\u4e00\u4e2a\u5947\u602a\u7684\u5b9e\u4f53\u7684\u76d1\u7ba1\u3002\\n\\n 3\\n 00:00:09,050 --\x3e 00:00:13,453It feels like a huge bureaucracy is making decisions over our heads.\\n \u611f\u89c9\u5c31\u50cf\u4e00\u4e2a\u5de8\u5927\u7684\u5b98\u50da\u673a\u6784 \u6b63\u5728\u6211\u4eec\u7684\u5934\u8111\u4e2d\u505a\u51fa\u51b3\u5b9a\u3002\\n ```\\n\\nSe elimin\xf3 la l\xednea de tiempo en blanco para descargar subt\xedtulos.\\n\\n```\\n 1\\n 00:00:00,000 --\x3e 00:00:00,500\\n\\n\\n\\n 2\\n 00:00:00,500 --\x3e 00:00:03,090\\n PETE LEPAGE: You can now upload extensions using Manifest\\n PETE LEPAGE: \u60a8\u73b0\u5728\u53ef\u4ee5 \u4f7f\u7528 Manifest V3 \u5c06\u6269\u5c55\u7a0b\u5e8f\u4e0a\u4f20\\n\\n 3\\n 00:00:03,090 --\x3e 00:00:05,100\\n V3 to the Chrome Web Store.\\n \u5230 Chrome \u7f51\u4e0a\u5e94\u7528\u5e97\u3002\\n ```\\n\\n### Los subt\xedtulos duales dan prioridad a los subt\xedtulos de video\\n\\n En el pasado, los subt\xedtulos biling\xfces siempre se traduc\xedan autom\xe1ticamente. Ahora, los subt\xedtulos existentes del video se usar\xe1n primero y se usar\xe1 la traducci\xf3n autom\xe1tica si no hay subt\xedtulos.\\n\\n Si el video biling\xfce ya tiene subt\xedtulos, se mostrar\xe1 un indicador de optimizaci\xf3n.\\n\\n La descarga de subt\xedtulos tambi\xe9n tendr\xe1 la misma optimizaci\xf3n, con una marca en medio del nombre del archivo.\\n\\n<Tip>El logotipo indica que los subt\xedtulos biling\xfces actuales usan los subt\xedtulos existentes del video, no la traducci\xf3n autom\xe1tica.</Tip>\\n\\n<img src={mark} alt=\\"mark.png\\" width=\\"891\\" height=\\"262\\" />\\n\\n### Desactivar estilos personalizados\\n\\n Esta versi\xf3n ofrece la opci\xf3n de desactivar el estilo personalizado y puede establecer el orden y el espaciado de los subt\xedtulos de forma independiente.\\n\\n<Tip>Consejo: La premisa de esta optimizaci\xf3n es que los dos subt\xedtulos deben coincidir exactamente.</Tip>\\n\\n<img src={disableStyle} alt=\\"disableStyle.gif\\" width=\\"340\\" height=\\"585\\" />\\n\\n### Descarga los subt\xedtulos en el mismo orden en que se muestran\\n\\n<img src={order} alt=\\"order.gif\\" width=\\"340\\" height=\\"585\\" />\\n\\n<WebStore />"},{"id":"/3_5_0","metadata":{"permalink":"/es/3_5_0","source":"@site/i18n/es/docusaurus-plugin-content-blog/3_5_0/index.mdx","title":"Notas de actualizaci\xf3n de YouTube\u2122 Dual Caption 3.5.0","description":"Estilo de fuente personalizado","date":"2021-08-24T00:00:00.000Z","formattedDate":"24 de agosto de 2021","tags":[],"hasTruncateMarker":false,"authors":[{"name":"ouweiya","title":"Web Development","url":"https://github.com/ouweiya","imageURL":"img/avatar.png","key":"ouweiya"}],"frontMatter":{"authors":"ouweiya","date":"2021-08-24T00:00:00.000Z"},"prevItem":{"title":"Notas de actualizaci\xf3n de YouTube\u2122 Dual Caption 3.6.0","permalink":"/es/3_6_0"}},"content":"import WebStore from \'/src/components/WebStore\';\\nimport Tip from \'/src/components/Tip\';\\nimport light from \'./light.png\';\\nimport dark from \'./dark.png\';\\nimport tip from \'./tip.gif\';\\nimport singlebutton from \'./singlebutton.png\';\\nimport single from \'./single.png\';\\nimport translationError from \'./translationError.gif\';\\n\\n\\n### Estilo de fuente personalizado\\n\\nHaga clic en el icono de la extensi\xf3n para abrir la p\xe1gina de configuraci\xf3n y admitir el modo oscuro.\\n\\nOpciones personalizadas: fuente, tama\xf1o de fuente, color, color de fondo, espaciado y orden de los subt\xedtulos.\\n\\n<img src={light} alt=\\"light.png\\" width=\\"340\\" height=\\"472\\" />\\n<img src={dark} alt=\\"dark.png\\" width=\\"340\\" height=\\"472\\" />\\n\\n<Tip>Al pasar el cursor sobre el icono, se revelar\xe1 lo que representa la configuraci\xf3n.</Tip>\\n\\n<img src={tip} alt=\\"tip.gif\\" width=\\"340\\" height=\\"472\\" />\\n\\n### Estilo de subt\xedtulo \xfanico\\n\\nDespu\xe9s de cambiar al modo de subt\xedtulos \xfanicos, el estilo de subt\xedtulos \xfanicos se puede configurar de forma independiente.\\n\\n<img src={singlebutton} alt=\\"singlebutton.png\\" width=\\"314\\" height=\\"372\\" />\\n<img src={single} alt=\\"single.png\\" width=\\"340\\" height=\\"406\\" />\\n\\n### Otras optimizaciones\\n\\nElimine la biblioteca de programas de chino tradicional a simplificado, reduzca el tama\xf1o del programa y mejore el rendimiento, porque YouTube solucion\xf3 oficialmente este error.\\n\\n<Tip>A veces faltan subt\xedtulos, principalmente debido a errores de traducci\xf3n de YouTube.</Tip>\\n\\n<img src={translationError} alt=\\"translationError.gif\\" width=\\"700\\" height=\\"396\\" />\\n\\nEn el futuro, se introducir\xe1n otros motores de traducci\xf3n para resolver este problema y compensar la inexactitud de la traducci\xf3n.\\n\\n<WebStore />"}]}')}}]);